CREATE TABLE Continent
(
	Continent_Orignin varchar(35) primary key not null,
	AVG_aroma float,
	AVG_flavor float,
	AVG_aftertaste float,
	AVG_acidity float,
	AVG_body float,
	AVG_balance float,
	AVG_uniformity float,
	AVG_clean_cup float,
	AVG_sweetness float,
	AVG_moisture float,
	AVG_quakers float,
	AVG_defects_one float,
	AVG_defects_two float
);

CREATE TABLE Country
(
	Country_origin varchar(35) primary key not null,
	AVG_aroma float,
	AVG_flavor float,
	AVG_aftertaste float,
	AVG_acidity float,
	AVG_body float,
	AVG_balance float,
	AVG_uniformity float,
	AVG_clean_cup float,
	AVG_sweetness float,
	AVG_moisture float,
	AVG_quakers float,
	AVG_defects_one float,
	AVG_defects_two float
);

CREATE TABLE Coffee_Batch
(
	REC_id int primary key not null,
	Continent_fk varchar(35),
	Country_fk varchar(35),
	Processing_Method varchar(20),
	Harvest_year numeric(4,0),
	Expiration_date date,
	FOREIGN KEY (Continent_fk) REFERENCES Continent (Continent_Orignin),
	FOREIGN KEY (Country_fk) REFERENCES Country (Country_origin)
);

CREATE TABLE Coffee_Quality
(
	REC_id_fk int not null,
	Species varchar(8),
	Variety varchar(25),
	Color varchar(25),
	Aroma Numeric(3,2),
	Flavor Numeric(3,2),
	Aftertaste Numeric(3,2),
	Acidity Numeric(3,2),
	Body Numeric(3,2),
	Balance Numeric(3,2),
	Uniformity Numeric(3,2),
	Clean_cup Numeric(3,2),
	Sweetness Numeric(3,2),
	Moisture Numeric(3,2),
	Quakers Numeric(3,2),
	Defect_one Numeric(3,2),
	Defect_two Numeric(3,2),
	FOREIGN KEY (REC_id_fk) REFERENCES Coffee_Batch (REC_id)
);


